import React from "react";
import search from "../images/search_btn.svg";

const Search = ({ handleSearchModal }) => {
  return (
    <div
      className="flex items-center justify-center fixed top-0 left-0 right-0 bottom-0 bg-modal z-50"
      onClick={handleSearchModal}
    >
      {/* 345*185 */}
      <div
        className="flex items-center px-5 py-4 w-10/12 h-16 rounded-lg bg-white"
        onClick={(e) => e.stopPropagation()}
      >
        <img className="w-8 h-16" src={search} alt="search-button" />

        <input className="w-full h-full border-solid border-gray-light border-focus:ring-1 focus:ring-primary"></input>
      </div>
    </div>
  );
};

export default Search;
